MysqlMatchTest.create(:name => '錦織 圭', :desc => '錦織 圭（にしこり けい、1989年12月29日?- ）は、島根県松江市出身の男子プロテニス選手。日清食品所属。松江市立乃木小学校、開星中学校、青森山田高校卒業[2]。身長178cm、体重75kg。右利き、バックハンド・ストロークは両手打ち。ATP（男子プロテニス協会）が発表する世界ランキング自己最高位はシングルス4位（アジア男子歴代最高位）、ダブルス160位。 ')
MysqlMatchTest.create(:name => '大坂 なおみ', :desc => '大坂 なおみ（おおさか なおみ、英: Naomi Osaka、1997年10月16日 - ）は、大阪府大阪市中央区出身の女子プロテニス選手[4][5]。自己最高ランキングはシングルス1位。これまでにWTAツアーでシングルス5勝を挙げている。身長180cm。体重69kg。右利き、バックハンド・ストロークは両手打ち。2019年までは日米二重国籍だったが[5]、22歳の誕生日を迎えるにあたり日本国籍を選択、選手登録は日本[6]。')
MysqlMatchTest.create(:name => '羽生 結弦', :desc => '羽生 結弦（はにゅう ゆづる、英語: Yuzuru Hanyu、1994年（平成6年）12月7日[8][11] - ）は、宮城県仙台市泉区出身のフィギュアスケート選手（男子シングル）、栄典：紫綬褒章 受賞者（2014年・2018年）､ 国民栄誉賞 最年少受賞者（2018年）。全日本空輸 ANA所属[16]。早稲田大学 (人間科学部通信教育課程）在学中[17][18][19]。主要な戦績、2014年ソチオリンピック・2018年平昌オリンピック66年ぶり2大会連続優勝。')
MysqlMatchTest.create(:name => '髙橋 聡文', :desc => '髙橋 聡文（たかはし あきふみ、1983年5月29日 - ）は、福井県大飯郡高浜町出身の元プロ野球選手（投手）。左投左打。プロの投手としては小柄ながら、柔軟性のある体を躍動させるダイナミックなフォームが特徴。一軍の公式戦には、中日時代から実働16年間で通算531試合に登板したが、すべて救援での起用であった[32]。真上から振り下ろすオーバースロー[33]から平均球速145km/h[34]、最速153km/h[33]の速球が投球の7割を占めていた。')
MysqlMatchTest.create(:name => '福留 孝介', :desc => '福留 孝介（ふくどめ こうすけ、1977年4月26日 - ）は、阪神タイガースに所属する鹿児島県曽於郡大崎町出身のプロ野球選手（外野手）。右投左打。高校時代より節目ごとにフォーム改造に取り組んでおり、打球を広角に放つことができる[88]。中日時代に30本塁打以上を2度記録しているが、カブス移籍後は1、2番での起用が多くなり、出塁を優先するスタイルとなった[89]。')
MysqlMatchTest.create(:name => '藤井 聡太', :desc => '藤井 聡太（ふじい そうた、2002年7月19日 - ）は将棋棋士[1]。杉本昌隆八段門下[1]。棋士番号は307[1]。愛知県瀬戸市出身[1]。名古屋大学教育学部附属高等学校在学中（2018年4月 - ）[2][3]。居飛車党[85]。得意戦法は角換わりで、角の使い方が独特である[86]。')
MysqlMatchTest.create(:name => '東京タワー', :desc => '東京タワー（とうきょうタワー、英: Tokyo Tower）は、東京都港区芝公園にある総合電波塔の愛称である。正式名称は日本電波塔（にっぽんでんぱとう）。1958年12月23日竣工。東京のシンボル・観光名所として知られる。日本の「塔博士」とも称される内藤多仲らによって設計された（詳細は設計を参照）。')
MysqlMatchTest.create(:name => '東京スカイツリー', :desc => '東京スカイツリー（とうきょうスカイツリー、英: TOKYO SKYTREE）は、東京都墨田区押上一丁目にある電波塔（送信所）である。観光・商業施設やオフィスビルが併設されており、電波塔を含め周辺施設は「東京スカイツリータウン」と呼ばれている。2012年（平成24年）5月に電波塔・観光施設として開業した。')
MysqlMatchTest.create(:name => '渋谷スクランブルスクエア', :desc => '渋谷スクランブルスクエア（しぶやスクランブルスクエア、英称：Shibuya Scramble Square）は、東京都渋谷区渋谷2丁目にある渋谷駅に直結した複合施設型超高層ビル[4]。東棟はセルリアンタワーを抜いて渋谷で最も高いビルである。都市再生特別地区認定事業となっており、旧渋谷駅街区プロジェクトとして2014年6月に第1期着工。')
MysqlMatchTest.create(:name => '松岡 修造', :desc => '松岡 修造（まつおか しゅうぞう、1967年11月6日 - ）は、東京都出身の日本の元男子プロテニス選手、兼スポーツキャスター[1]、タレント、スポーツ解説者。現日本テニス協会理事強化本部副部長[2]。マネジメントはIMG JAPAN。身長188cm、体重85kg。血液型AB型。右利き、バックハンド・ストロークは両手打ち。ATP自己最高ランキングはシングルス46位、ダブルス95位。ATPツアーでシングルス1勝（日本人男子初のATPツアーシングルス優勝）、ダブルス1勝を挙げた。1995年ウィンブルドン選手権男子シングルスで日本人男子として62年振りにグランドスラムベスト8に進出した人物である。また、ウィンブルドン選手権での通算7勝は2015年に錦織圭に抜かれるまで日本人最多の記録であった。現役引退後はジュニア選手の指導やテニス大会の運営、日本テニス協会の理事を務めるなど引き続きテニスに携わりつつ、スポーツキャスター、タレント、日本オリンピック委員会スポーツ環境専門委員、ミズノスポーツ振興財団顧問[3] などとしても活動している。妻は元テレビ東京アナウンサーの田口惠美子で、田口との間に子どもが3人いる。')
